public static Document parse(String html, String baseUri) {
Parser parser = new Parser(html, baseUri, false);
return parser.parse();
}

public TextNode(String text, String baseUri) {
super(baseUri);
attributes.put(TEXT_KEY, text);
}

public static TextNode createFromEncoded(String encodedText, String baseUri) {
String text = StringEscapeUtils.unescapeHtml(encodedText);
return new TextNode(text, baseUri);
}

public DataNode(String data, String baseUri) {
super(baseUri);
attributes.put(DATA_KEY, data);
}

private Tag setOptionalClosing() {
optionalClosing = true;
return this;
}

private Tag setPreserveWhitespace() {
preserveWhitespace = true;
return this;
}

protected void setParentNode(Node parentNode) {
if (this.parentNode != null)
this.parentNode = parentNode;
}

private void html(StringBuilder accum) {
for (Node node : childNodes)
node.outerHtml(accum);
}

public void put(String key, String value) {
Attribute attr = new Attribute(key, value);
put(attr);
}

public void put(Attribute attribute) {
Validate.notNull(attribute);
attributes.put(attribute.getKey(), attribute);
}

static String normaliseWhitespace(String text) {
text = text.replaceAll("\\s{2,}|(\\r\\n|\\r|\\n)", " "); // more than one space, and newlines to " "
return text;
}

public static Document parse(String html) {
return Parser.parse(html, "");
}

public Document(String baseUri) {
super(Tag.valueOf("#root"), baseUri);
}

public Element body() {
return getElementsByTag("body").first();
}

public Element first() {
return !contents.isEmpty() ? contents.get(0) : null;
}

public boolean isEmpty() {
return queue.isEmpty();
}

private Element last() {
return stack.getLast();
}

public Character consume() {
return queue.removeFirst();
}

public boolean isData() {
return !canContainInline && !isEmpty();
}

public String tagName() {
return tag.getName();
}
